public class Solution {
    private const int Mod = 1000000007;

    public int MaximumScore(IList<int> nums, int k) {
        var primeFactors = new int[100001];
        for (int i = 2; i < 100001; i++) {
            if (primeFactors[i] == 0) {
                for (int j = i; j < 100001; j += i) {
                    primeFactors[j]++;
                }
            }
        }

        var scores = nums.Select(x => (long)x).ToArray();
        var primeScores = nums.Select(x => primeFactors[x]).ToArray();
        Array.Sort(primeScores, scores);

        long result = 1;
        for (int i = nums.Count - 1; i >= nums.Count - k; i--) {
            result = (result * scores[i]) % Mod;
        }

        return (int)result;
    }
}
